<html>
	<head>
        <meta http-equiv="Content-Type" content="text/html;charset=utf-8"/>
        <style type="text/css">
            body {
                font: 300 36px "Helvetica Neue";
                height: 640px;
                margin: 80px 160px 80px 160px;
                position: relative;
                width: 960px;
            }

            a:link, a:visited {
                color: #777;
                text-decoration: none;
            }

            a:hover {
                color: #666;
            }

            blockquote {
                margin: 0;
            }

            blockquote:before {
                content: "вЂњ";
                position: absolute;
                left: -.4em;
            }

            blockquote:after {
                content: "вЂќ";
                position: absolute;
            }

            body > ul {
                margin: 0;
                padding: 0;
            }

            h1 {
                font-size: 64px;
            }

            h1, h2, h3 {
                font-weight: inherit;
                margin: 0;
            }

            h2, h3 {
                text-align: right;
                font-size: inherit;
                position: absolute;
                bottom: 0;
                right: 0;
            }

            h2 {
                font-size: 24px;
                position: absolute;
            }

            h3 {
                bottom: -20px;
                font-size: 18px;
            }

            div#legend {
                font-size:14pt;
                top:700px;
                position:absolute;
            }

            .invert {
                background: #1f1f1f;
                color: #dcdccc;
            }

            .invert h2, .invert h3 {
                color: #7f9f7f;
            }

            .string, .regexp {
                color: #f39;
            }

            .keyword {
                color: #00c;
            }

            .comment {
                color: #777;
                font-style: oblique;
            }

            .number {
                color: #369;
            }

            .class, .special {
                color: #1181B8;
            }

            body > svg {
                position: absolute;
                top: -80px;
                left: -160px;
            }
        </style>
        <style type="text/css">

            path.arc {
                cursor: move;
                fill: #fff;
            }

            .node {
                font-size: 9px;
                font-weight: bold;
            }

            .node:hover {
                fill: #1f77b4;
            }

            .link {
                fill: none;
                stroke: #1f77b4;
                stroke-opacity: .4;
                pointer-events: none;
            }

            .link.source, .link.target {
                stroke-opacity: 1;
                stroke-width: 2px;
            }

            .node.target {
                fill: #d62728 !important;
            }

            .link.source {
                stroke: #d62728;
            }

            .node.source {
                fill: #2ca02c;
            }

            .link.target {
                stroke: #2ca02c;
            }

        </style>

        String.prototype.replaceAll = function(search, replace){

                rx = w / 2,
                ry = h / 2,
                m0,
                rotate = 0;

                .sort(function(a, b) { return d3.ascending(a.key, b.key); });

            d3.event.preventDefault();
        }

        function mousemove() {
            if (m0) {
                var m1 = mouse(d3.event),
                        dm = Math.atan2(cross(m0, m1), dot(m0, m1)) * 180 / Math.PI;
                div.style("-webkit-transform", "translate3d(0," + (ry - rx) + "px,0)rotate3d(0,0,0," + dm + "deg)translate3d(0," + (rx - ry) + "px,0)");
            }
        }

        function mouseup() {
            if (m0) {
                var m1 = mouse(d3.event),
                        dm = Math.atan2(cross(m0, m1), dot(m0, m1)) * 180 / Math.PI;

                rotate += dm;
                if (rotate > 360) rotate -= 360;
                else if (rotate < 0) rotate += 360;
                m0 = null;

                div.style("-webkit-transform", "rotate3d(0,0,0,0deg)");

                svg
                        .attr("transform", "translate(" + rx + "," + ry + ")rotate(" + rotate + ")")
                        .selectAll("g.node text")
                        .attr("dx", function(d) { return 8; })
                        .attr("text-anchor", function(d) { return "start"; })
                        .attr("transform", function(d) { return null; });
            }
        }

        function mouseover(d) {
            svg.selectAll("path.link.target-" + d.key.replaceAll(" ", "_"))
                    .classed("target", true)
                    .each(updateNodes("source", true));

            svg.selectAll("path.link.source-" + d.key.replaceAll(" ", "_"))
                    .classed("source", true)
                    .each(updateNodes("target", true));
        }

        function mouseout(d) {
            svg.selectAll("path.link.source-" + d.key.replaceAll(" ", "_"))
                    .classed("source", false)
                    .each(updateNodes("target", false));

            svg.selectAll("path.link.target-" + d.key.replaceAll(" ", "_"))
                    .classed("target", false)
                    .each(updateNodes("source", false));
        }

        function updateNodes(name, value) {
            return function(d) {
                if (value) this.parentNode.appendChild(this);
                svg.select("#node-" + d[name].key.replaceAll(" ", "_")).classed(name, value);
            };
        }

        function cross(a, b) {
            return a[0] * b[1] - a[1] * b[0];
        }

        function dot(a, b) {
            return a[0] * b[0] + a[1] * b[1];
        }

    </script>
    </body>
</html>
